# Volkovo, Cherkassky Selsoviet, Ufimsky District, Republic of Bashkortostan

}}
Volkovo () is a rural locality (a village) in Cherkassky Selsoviet, Ufimsky District, Bashkortostan, Russia. The population was 26 as of 2010.
Geography
It is located 35&nbsp;km from Ufa, 8&nbsp;km from Cherkassy.
